ה. לאור כל האמור, ולאור העובדה שהחשוד הביע נכונות להודות במיוחס לו, וכן להתנצל ולפצות את ע.ג, סברנו כי ההליך של הסדר מותנה הינו ההליך המתאים בנסיבות העניין. כמו כן, יוער כי גם עם שניים מהמתנדבים הנוספים שנכחו באירוע זה, נחתם הסדר מותנה בתיק דנן.

